import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

export default function Items() {
  const { itemID } = useParams();

  const [itemInfo, setItemInfo] = useState({
    id: "null",
    itemName: "null",
    itemPrice: "null",
    description: "null",
    category: "null",
    postTime: "null",
    editTime: "null",
    visitCount: "null",
    searchCount: "null",
    photo1Name: "null",
    photo2Name: "null",
    photo3Name: "null",
    status: "null",
  });

  useEffect(() => {
    axios
      .get(`/items/${itemID}`)
      .then((res) => {
        if (res.data !== "null") {
          setItemInfo(res.data[0]);
        }
      })
      .catch((err) => {
        console.error(err);
      });
  }, [itemID]);

  return <div>Items of {JSON.itemInfo}</div>;
}
